import React from "react";
import "../../App.css";
import Cards from "../Cards";
import Main from "../Main";
import { CardonContainer } from "cardon";
import Pop from "../popupgfg";

function Home() {
  return (
    <>
      <Main />
      <Cards />
      <CardonContainer />
      <Pop />
    </>
  );
}

export default Home;
